import React, {useState, useEffect} from 'react'
import PlayerDataService from "../../services/playersService";
import PlayerScorecardsService from "../../services/playerScorecardsService";

const SeasonRanking = () => {

  const [players, setPlayers] = useState([]);

    useEffect(() => {
        retrievePlayers();
    }, []);

    const retrievePlayers = () => {
        PlayerDataService.getAll()
            .then(response => {
                console.log(response.data);
                setPlayers(response.data.players);
            })
            .catch(e => {
                console.log(e);
            });
    };

  return (
    <>
      <h1>Season Rankings</h1>
      <table class="table table-condensed table-bordered">
        <tr class="success text-center">
          <th class="text-uppercase"><strong>Player Name</strong></th>
          <th class="text-uppercase"><strong>Points</strong></th>
        </tr>
        {players.map((player) => {
          return(
            <tr>
              <td>{player.name}</td>
            </tr>
          )
        })}

      </table>
    </>
  )
}

export default SeasonRanking
